import {TextField, Button} from '@mui/material';
import { useState } from 'react';

function RegisterUser() {


    const [firstName, setFirstName] = useState('');
    const [lastsName, setLastName] = useState('');
    const [email, setEmail] = useState('');
    const [userName, setUserName] = useState('');
    const [password, setPaswword] = useState('');

    return (
        <>
            <h1>Register User</h1>

            <form>

                <TextField id="name"
                    label="First Name"
                    variant="outlined"
                    value={firstName}
                    fullWidth
                    sx={{ mb: 4 }} />

                <TextField id="lastname"
                    label="Last Name"
                    variant="outlined"
                    value={lastsName}
                    fullWidth
                    sx={{ mb: 4 }} />

                <TextField id="email"
                    label="Email"
                    variant="outlined"
                    value={email}
                    fullWidth
                    sx={{ mb: 4 }} />

                <TextField id="username"
                    label="User Name"
                    variant="outlined"
                    value={userName}
                    fullWidth
                    sx={{ mb: 4 }} />

                <TextField id="password"
                    label="Password"
                    variant="outlined"
                    value={password}
                    fullWidth
                    sx={{ mb: 4 }} />

                    <Button 
                    variant="outlined" 
                    color="primary"
                    type="submit">Register User</Button>

            </form>
        </>
    )
}

export default RegisterUser;
